}

function secHandleClick () {
  return console.log('Teste.')
}

function thirdHandClick () {
  return console.log('Trybe!')
}

function App() {
  return (
    <div>
    <button onClick={handleClick}>Botão</button>
    <button onClick={secHandleClick}>Botão</button>
    <button onClick={thirdHandClick}>Botão</button>
    </div>
  );
}

export default App;
